import React, { Component } from 'react';
import { Card } from 'primereact/card';

class Hlavnicards extends Component {


    render() {
        const { currentDate, summary } = this.props;
        return (

            <div class="p-grid">
                <div class="p-col p-md-4" style={{ textAlign: 'center' }}>

                <Card title="Infected" subTitle={summary.TotalConfirmed} style={{ width: '360px' }} >
                        {new Date(currentDate).toDateString()}
                    </Card>

                </div>
                <div class="p-col p-md-4" style={{ textAlign: 'center' }}>
                <Card title="Deaths" subTitle={summary.TotalDeaths} style={{ width: '360px' }} >
                        {new Date(currentDate).toDateString()}
                    </Card>

                </div>
                <div class="p-col p-md-4" style={{ textAlign: 'center' }}>

                    <Card title="Recovered" subTitle={summary.TotalRecovered} style={{ width: '360px' }} >
                        {new Date(currentDate).toDateString()}
                    </Card>

                </div>
            </div>

        );
    }
}

export default Hlavnicards;
